
-- AdSphere (single-file) - Synthetic Social Media Advertising Dataset
-- MySQL 8.x compatible
-- Changes in this build:
--  * Database name: adsphere
--  * Guaranteed unique advertiser names
--  * Bulk inserts wrapped with FOREIGN_KEY_CHECKS=0/1
--  * Views + procedure defined AFTER data loads with explicit DELIMITER

DROP DATABASE IF EXISTS adsphere;
CREATE DATABASE adsphere CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci;
USE adsphere;

-- =====================================================
-- Reference tables
-- =====================================================
CREATE TABLE country (
  country_id INT PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(64) NOT NULL UNIQUE
) ENGINE=InnoDB;

CREATE TABLE platform (
  platform_id INT PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(64) NOT NULL UNIQUE
) ENGINE=InnoDB;

CREATE TABLE placement (
  placement_id INT PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(64) NOT NULL UNIQUE
) ENGINE=InnoDB;

CREATE TABLE device_type (
  device_type_id INT PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(32) NOT NULL UNIQUE
) ENGINE=InnoDB;

CREATE TABLE event_type (
  event_type_id INT PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(40) NOT NULL UNIQUE
) ENGINE=InnoDB;

-- =====================================================
-- Core business entities
-- =====================================================
CREATE TABLE advertiser (
  advertiser_id INT PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(128) NOT NULL UNIQUE,
  website VARCHAR(255) NULL,
  country_id INT NULL,
  industry VARCHAR(64) NULL,
  CONSTRAINT fk_adv_country FOREIGN KEY (country_id) REFERENCES country(country_id)
    ON UPDATE CASCADE ON DELETE SET NULL
) ENGINE=InnoDB;

CREATE TABLE campaign (
  campaign_id INT PRIMARY KEY AUTO_INCREMENT,
  advertiser_id INT NOT NULL,
  name VARCHAR(160) NOT NULL,
  objective ENUM('reach','traffic','video_views','conversions','sales') NOT NULL,
  daily_budget DECIMAL(10,2) NOT NULL,
  start_date DATE NOT NULL,
  end_date DATE NULL,
  status ENUM('active','paused','completed') NOT NULL DEFAULT 'active',
  CONSTRAINT fk_campaign_adv FOREIGN KEY (advertiser_id) REFERENCES advertiser(advertiser_id)
    ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB;

CREATE TABLE ad (
  ad_id INT PRIMARY KEY AUTO_INCREMENT,
  campaign_id INT NOT NULL,
  platform_id INT NOT NULL,
  placement_id INT NOT NULL,
  name VARCHAR(160) NOT NULL,
  headline VARCHAR(180) NOT NULL,
  ad_text TEXT NOT NULL,
  cta ENUM('Learn More','Shop Now','Sign Up','Download','Subscribe','Get Offer') NOT NULL,
  bid_cents INT NOT NULL,
  creative_format ENUM('image','video','carousel','text') NOT NULL,
  url VARCHAR(255) NULL,
  created_at DATETIME NOT NULL,
  status ENUM('active','paused','archived') NOT NULL DEFAULT 'active',
  CONSTRAINT fk_ad_campaign FOREIGN KEY (campaign_id) REFERENCES campaign(campaign_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_ad_platform FOREIGN KEY (platform_id) REFERENCES platform(platform_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_ad_placement FOREIGN KEY (placement_id) REFERENCES placement(placement_id)
    ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB;

-- =====================================================
-- Users
-- =====================================================
CREATE TABLE user_profile (
  user_id INT PRIMARY KEY AUTO_INCREMENT,
  first_name VARCHAR(50) NOT NULL,
  last_name VARCHAR(50) NOT NULL,
  email VARCHAR(120) NOT NULL UNIQUE,
  gender ENUM('female','male','nonbinary','other','prefer_not_to_say') NOT NULL,
  birth_year SMALLINT NOT NULL,
  country_id INT NOT NULL,
  city VARCHAR(80) NULL,
  interests JSON NULL,
  created_at DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
  CONSTRAINT fk_user_country FOREIGN KEY (country_id) REFERENCES country(country_id)
    ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB;

-- =====================================================
-- Events (facts table)
-- =====================================================
CREATE TABLE ad_event (
  ad_event_id BIGINT PRIMARY KEY AUTO_INCREMENT,
  ad_id INT NOT NULL,
  user_id INT NOT NULL,
  platform_id INT NOT NULL,
  device_type_id INT NOT NULL,
  event_type_id INT NOT NULL,
  event_time DATETIME NOT NULL,
  session_id CHAR(32) NOT NULL,
  cost DECIMAL(8,4) NOT NULL DEFAULT 0.0000,
  revenue DECIMAL(8,4) NOT NULL DEFAULT 0.0000,
  extra JSON NULL,
  CONSTRAINT fk_evt_ad FOREIGN KEY (ad_id) REFERENCES ad(ad_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_evt_user FOREIGN KEY (user_id) REFERENCES user_profile(user_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_evt_platform FOREIGN KEY (platform_id) REFERENCES platform(platform_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_evt_device FOREIGN KEY (device_type_id) REFERENCES device_type(device_type_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_evt_et FOREIGN KEY (event_type_id) REFERENCES event_type(event_type_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  INDEX ix_evt_time (event_time),
  INDEX ix_evt_user (user_id),
  INDEX ix_evt_ad (ad_id)
) ENGINE=InnoDB;

-- =====================================================
-- Data loads (FK checks disabled temporarily)
-- =====================================================
SET FOREIGN_KEY_CHECKS=0;















SET FOREIGN_KEY_CHECKS=1;


-- =====================================================
-- Views & procedure (after data load)
-- =====================================================
CREATE OR REPLACE VIEW v_ad_performance AS
SELECT
  a.ad_id,
  a.name AS ad_name,
  pl.name AS platform,
  pc.name AS placement,
  c.campaign_id,
  c.name AS campaign_name,
  adv.name AS advertiser_name,
  SUM(CASE WHEN et.name='impression' THEN 1 ELSE 0 END) AS impressions,
  SUM(CASE WHEN et.name='click' THEN 1 ELSE 0 END) AS clicks,
  SUM(CASE WHEN et.name='purchase' THEN 1 ELSE 0 END) AS purchases,
  SUM(e.cost) AS total_cost,
  SUM(e.revenue) AS total_revenue
FROM ad a
JOIN campaign c ON c.campaign_id = a.campaign_id
JOIN advertiser adv ON adv.advertiser_id = c.advertiser_id
JOIN platform pl ON pl.platform_id = a.platform_id
JOIN placement pc ON pc.placement_id = a.placement_id
LEFT JOIN ad_event e ON e.ad_id = a.ad_id
LEFT JOIN event_type et ON et.event_type_id = e.event_type_id
GROUP BY a.ad_id;

DELIMITER //
DROP PROCEDURE IF EXISTS sp_top_ads_by_roi//
CREATE PROCEDURE sp_top_ads_by_roi(IN p_limit INT)
BEGIN
  SELECT ad_id, ad_name,
         CASE WHEN total_cost > 0 THEN (total_revenue - total_cost)/total_cost ELSE NULL END AS roi
  FROM v_ad_performance
  ORDER BY roi DESC
  LIMIT p_limit;
END//
DELIMITER ;
